// Login.js
import React, { useState, useEffect } from 'react';
import axios from 'axios';

// Configure axios defaults if not already configured
if (!axios.defaults.withCredentials) {
  axios.defaults.withCredentials = true;
}

const Login = ({ onLogin, onOTPRequired }) => {
  const [clientId, setClientId] = useState('');
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState('');
  const [debugInfo, setDebugInfo] = useState(null);

  // Function to fetch debug data
  const fetchDebugInfo = async () => {
    try {
      const response = await axios.get('http://localhost:5000/debug/api-log');
      setDebugInfo(response.data);
    } catch (error) {
      console.error('Error fetching debug info:', error);
    }
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setLoading(true);
    setError('');

    try {
      console.log('Authenticating client:', clientId);

      const response = await axios.post('http://localhost:5000/api/login', {
        client_id: clientId
      });

      // Handle authentication response
      if (response.data.status === 'SUCCESS') {
        // Store client_id in localStorage for persistence across page refreshes
        localStorage.setItem('clientId', clientId);

        if (response.data.needOTP) {
          // If OTP is needed, redirect to OTP verification
          onOTPRequired(clientId);
        } else {
          // If already authenticated, proceed to success
          onLogin(response.data);
        }
      } else {
        setError(response.data.message || 'Authentication failed');
      }
    } catch (error) {
      console.error('Error during login:', error);

      if (error.response) {
        setError(error.response.data.message || 'Server error during authentication');
      } else if (error.request) {
        setError('Could not connect to server. Please check if the server is running.');
      } else {
        setError('Error during authentication: ' + error.message);
      }
    } finally {
      setLoading(false);
      // Fetch updated debug info after the operation
      fetchDebugInfo();
    }
  };

  // Fetch debug info when component mounts
  useEffect(() => {
    fetchDebugInfo();
  }, []);

  return (
    <div className="container mt-5">
      <div className="row justify-content-center">
        <div className="col-md-6">
          <div className="card">
            <div className="card-header">
              <h3 className="text-center">MOFSL Authentication</h3>
            </div>
            <div className="card-body">
              {error && (
                <div className="alert alert-danger" role="alert">
                  {error}
                </div>
              )}
              <form onSubmit={handleSubmit}>
                <div className="form-group mb-3">
                  <label htmlFor="clientId">Client ID</label>
                  <input
                    type="text"
                    className="form-control"
                    id="clientId"
                    value={clientId}
                    onChange={(e) => setClientId(e.target.value)}
                    placeholder="Enter your client ID"
                    disabled={loading}
                    required
                  />
                </div>
                <div className="d-grid">
                  <button
                    type="submit"
                    className="btn btn-primary"
                    disabled={loading || !clientId}
                  >
                    {loading ? 'Authenticating...' : 'Login'}
                  </button>
                </div>
              </form>
            </div>
          </div>
        </div>
      </div>

      {/* Debug Information Panel */}
      <div className="row mt-4">
        <div className="col-12">
          <div className="card">
            <div className="card-header d-flex justify-content-between align-items-center">
              <h4>API Interactions Debug</h4>
              <button className="btn btn-sm btn-info" onClick={fetchDebugInfo}>
                Refresh Debug Info
              </button>
            </div>
            <div className="card-body">
              <div className="debug-info" style={{ maxHeight: '400px', overflow: 'auto' }}>
                {debugInfo ? (
                  <table className="table table-sm table-striped">
                    <thead>
                      <tr>
                        <th>Timestamp</th>
                        <th>Direction</th>
                        <th>Endpoint</th>
                        <th>Data</th>
                      </tr>
                    </thead>
                    <tbody>
                      {debugInfo.map((item, index) => (
                        <tr key={index}>
                          <td>{item.timestamp}</td>
                          <td>
                            {item.direction.includes('REQUEST') ? (
                              <span className="badge bg-primary">REQUEST</span>
                            ) : (
                              <span className="badge bg-success">RESPONSE</span>
                            )}
                          </td>
                          <td>{item.endpoint}</td>
                          <td>
                            <pre style={{ maxHeight: '100px', overflow: 'auto' }}>
                              {JSON.stringify(item.data, null, 2)}
                            </pre>
                          </td>
                        </tr>
                      ))}
                    </tbody>
                  </table>
                ) : (
                  <p>Loading debug information...</p>
                )}
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Login;
